import React from 'react';
import styled from 'styled-components';

const Main = styled.div`
    height: 850px;
    width: 100%;
    background-color: rgba(20, 18, 24, 0.9);
    box-sizing: border-box;

`;
const Text = styled.div`
    margin: auto;
    width: 1200px;
    font-size: 48px;
    color: white;
`;

const NoMatch = () => {
    return (
        <Main >
           <Text>
               Sorry, page not found!
            </Text>
        </Main>
    )
};

export default NoMatch;
